recurse_binaryfn(`+`,list(1,c(2,3),4,c(5,6)))
# means:  1 + c(2,3) + 4 + c(5,6)
recurse_binaryfn &lt;- function(f,l){
    if(length(l)==2){
      return( f(l[[1]],l[[2]]) )
    } else {
      return( f(l[[1]],recurse_binaryfn(f,l[2:length(l)])) )
    }
 }
